import React from "react";
import styled from "styled-components";
import { GiHamburgerMenu } from "react-icons/gi";
import { AiOutlineSearch } from "react-icons/ai";
const SecondNavbar = () => {
  return (
    <Wrapper>
      <div className="containermain">
        <div className="category">
          <GiHamburgerMenu />
          Kateqoriyalari goster
        </div>

        <div className="search">
          <input type="text" placeholder="Mehsul axtar" className="secinput" />
          <button>
          <AiOutlineSearch />
          </button>
        </div>
      </div>
    </Wrapper>
  );
};

const Wrapper = styled.div`
  width: 100%;
  background: var(--main-color);
  height: 10vh;
  display: flex;

  .containermain {
      background: red;
      width: 40%;
      height: 100%;
      margin-left: 11%;
      display: flex;
      align-items: center;
      justify-content: space-between;
  }
  .secinput {
    width: 100%;
    padding: 0px;
    border: none;
    outline: none;
    border-radius: 15px

  }

    .category {
        width: 260px;
        background: white;
        color: var(--main-color);
        text-align: center;
        border-radius: 15px;
        padding-left: 10px;
    }
    .category i {
        font-size: 20px; 
    }
     

     .search {
         width: 610px;
         height: 50px;
         display: flex;
         align-items: center;
         border-radius: 15px;
         background: orange;
        padding: 6px;
     }
.search button {
    border: none;
    outline: none;
    background: none;
    font-size: 22px;
    color: var(--main-color);

}
`;
export default SecondNavbar;
